s = ""
# s = ""

s_split = [s[i : i + 32] for i in range(0, len(s), 32)]
bits = "0"
ptn = None
for tok in s_split:
    if ptn is None:
        ptn = tok

    if tok == ptn:
        bits += "1"
    else:
        bits += "0"

while bits:
    byte = bits[:8]
    bits = bits[8:]
    if len(byte) < 8:
        byte = byte.ljust(8, "0")
    # print(byte, chr(int(byte, 2)))
    print(chr(int(byte, 2)), end="")
